// Solution 1:
class Solution {
public:
    vector<vector<char>> transpose(vector<vector<char>>& A) {
        int m = A.size(), n = A[0].size();
        vector<vector<char>> B;
        for (int i = 0; i < n; ++i) {
            vector<char> tmp;
            for (int j = 0; j < m; ++j) {
                tmp.push_back(A[j][i]);
            }
            B.push_back(tmp);
        }
        return B;
    }
};

// Solution 2:
class Solution {
public:
    vector<vector<char>> transpose(vector<vector<char>>& A) {
        int m = A.size(), n = A[0].size();
        for (int i = 0; i < m; ++i) {
            for (int j = 0; j < i; ++j) {
                swap(A[i][j], A[j][i]);
            }
        }
        for (auto &row : A) reverse(row.begin(), row.end());
        return A;
    }
};
